import React from 'react'
import { createTheme } from '@mui/material';

const AppTheme = () => {
  const defaultTheme = createTheme({
    palette: {
      primary: {
        main: "#03074f"
      },
      secondary: {
        main: '#fff'
      }
    },
    typography: {
      navbar: {
        fontSize: '5rem'
      }
    }
  })

  return defaultTheme;
}

export default AppTheme;
